// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract HealthSync {
    enum HealthStatus {Sold, Available}
    
    string public companyName;
    uint HealthCount;

    // Constructor code is only run when the contract is created
    constructor() {
        HealthCount=0;
        companyName = "HealthSync";
    }

    //declare the structure of the Health  data
   struct HealthInformation {
        string id;
        string name;
        string gender;
        string dateOfBirth;
        uint price;
        HealthStatus status;
    }

    //declare the structure for the owner data
    struct OwnershipRecord {
        address payable ownerId;
        string ownerName;
        string transferDate;
        string phone;
        string email;  
    } 

    // declare the structure for the vaccination record
    struct VaccinationRecord {
        string vaccineName;
        string dateAdministered;
        string doctorname;
        string clinic;
        string phone;
        string email;
    }

    // declare the structure of the training record
    struct TrainingRecord {
        string trainingType;
        string traninerName;
        string organization;
        string phone;
        string trainingDate;
        string progress;
    }

    //declare the structure for the Health information - 
    //which consists of HealthCount, ownership, vaccination and trainingrecord
    struct Health {
        HealthInformation HealthInfo;
        OwnershipRecord[] ownershipRecords;
        VaccinationRecord[] vaccinationHistory;
        TrainingRecord[] trainingHistory;
    }
    //map the Health  id to the Health  structure and hold them in the mapping variable Health 
    mapping(uint256 => Health) public Healths;

    //write the getter functions
    // function to get the company name getCompanyName() 
    function getCompanyName() public view returns(string memory){
        return companyName;
    }

    //Write a function getNoOfHealth  to obtain the HealthCount
    function getNoOfHealth() public view returns (uint) {
        return HealthCount;
    }

     // Function to retrieve Health   information
    function getHealthInfo(uint256 HealthId) public view returns (HealthInformation memory) {
        return Healths[HealthId].HealthInfo;
    }

     // Function to retrieve ownership records
    function getOwnershipRecords(uint256 HealthId) public view returns (OwnershipRecord[] memory) {
        return Healths[HealthId].ownershipRecords;
    }

    // Function to retrieve vaccination records
    function getVaccinationRecords(uint256 HealthId) public view returns (VaccinationRecord[] memory) {
        return Healths[HealthId].vaccinationHistory;
    }

    // Function to retrieve training records
    function getTrainingRecords(uint256 HealthId) public view returns (TrainingRecord[] memory) {
        return Healths[HealthId].trainingHistory;
    }

    //function to register the Health 
    function registerHealth () public returns (uint256) {
        HealthCount++;    
        return HealthCount;
    }

          
    // Function to add Health   information
    function addHealthInfo(
        uint256 HealthId,
        string memory _id,
        string memory _name,
        string memory _gender,
        string memory _dateOfBirth,
        uint price
    ) public {
        Healths[HealthId].HealthInfo = HealthInformation(_id, _name, _gender, _dateOfBirth, price, HealthStatus.Available);
    }

      
    // Function to add a new ownership record
    function addOwnerShipRecord (uint256 HealthId, 
        string memory _ownerName,
        string memory _transferDate,
        string memory _phone,
        string memory _email ) public {
            Healths[HealthId].ownershipRecords.push(OwnershipRecord(payable(msg.sender), _ownerName, _transferDate, _phone, _email));
           
    }

    function addVaccinationRecord (uint256 HealthId, 
        string memory _vaccineName,
        string memory _dateAdministered,
        string memory _doctorname,
        string memory _clinic,
        string memory _phone,
        string memory _email) public {
            Healths[HealthId].vaccinationHistory.push(VaccinationRecord(_vaccineName, _dateAdministered, _doctorname, _clinic, _phone, _email));
    }

    function addTrainingRecord (uint256 HealthId, 
         string memory _trainingType,
        string memory _trainerName,
        string memory _organization,
        string memory _phone,
        string memory _trainingDate,
        string memory _progress) public {
            Healths[HealthId].trainingHistory.push(TrainingRecord(_trainingType, _trainerName, _organization, _phone,
        _trainingDate, _progress));
    }


      //create the event to purchase the Health 
    event HealthPurchased(
        uint id,
        string name,
        uint price,
        address payable owner,
        HealthStatus status
    );


   //add a function to purchase Health  with the Health  id
    function purchaseHealth(uint _id) public payable {
        // Fetch the product
        Health memory HealthData = Healths[_id];
        // Fetch the owner
        uint256 curOwnerId = HealthData.ownershipRecords.length;
        address payable seller = HealthData.ownershipRecords[curOwnerId-1].ownerId;
        // Make sure the product has a valid id
        require(HealthCount > 0 && bytes(HealthData.HealthInfo.id).length != 0, "Health  Id cannot be empty" );
        // Require that there is enough Ether in the transaction
        require(msg.value >= HealthData.HealthInfo.price);
        // Require that the product has not been purchased already
        require(HealthData.HealthInfo.status == HealthStatus.Available);
        // Require that the buyer is not the seller
        require(seller != msg.sender);
        // Transfer ownership to the buyer
        //HealthData.ownershipRecords[curOwnerId ++].ownerId = payable(msg.sender);
        // Mark as purchased
        HealthData.HealthInfo.status = HealthStatus.Sold;
        // Update the Health  information
        Healths[_id].HealthInfo = HealthData.HealthInfo;
        // Pay the seller by sending them Ether
        payable(seller).transfer(msg.value);
        // Trigger an event
        emit HealthPurchased(HealthCount, HealthData.HealthInfo.name, HealthData.HealthInfo.price, payable(msg.sender), HealthStatus.Sold);
    }
}
